import React, { useState, useEffect } from 'react';
import './App.css';
import { FiClock, FiCoffee, FiActivity, FiAlertCircle, FiCheckCircle } from 'react-icons/fi';

function App() {
  const [screenTime, setScreenTime] = useState(0);
  const [breaks, setBreaks] = useState(0);
  const [lastBreak, setLastBreak] = useState(0);
  const [prediction, setPrediction] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const getRiskColor = (risk) => {
    const colors = {
      low: '#4CAF50',
      medium: '#FF9800',
      high: '#F44336'
    };
    return colors[risk] || '#757575';
  };

  const predictBurnout = async () => {
    setLoading(true);
    setError(null);
    try {
      const response = await fetch('http://localhost:5001/predict', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          screen_time: parseInt(screenTime),
          breaks: parseInt(breaks),
          last_break: parseInt(lastBreak)
        })
      });

      if (!response.ok) {
        throw new Error('Failed to get prediction');
      }

      const data = await response.json();
      setPrediction(data);
    } catch (err) {
      setError('Failed to get prediction. Please try again.');
      console.error('Error:', err);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="app">
      <header className="app-header">
        <h1>Tech Breaks</h1>
        <p>Monitor your digital wellbeing</p>
      </header>

      <main className="app-main">
        <section className="input-section">
          <div className="input-group">
            <FiClock className="input-icon" />
            <div className="input-field">
              <label>Screen Time (minutes)</label>
              <input
                type="number"
                value={screenTime}
                onChange={(e) => setScreenTime(e.target.value)}
                placeholder="Enter screen time"
                min="0"
              />
            </div>
          </div>

          <div className="input-group">
            <FiCoffee className="input-icon" />
            <div className="input-field">
              <label>Number of Breaks</label>
              <input
                type="number"
                value={breaks}
                onChange={(e) => setBreaks(e.target.value)}
                placeholder="Enter number of breaks"
                min="0"
              />
            </div>
          </div>

          <div className="input-group">
            <FiActivity className="input-icon" />
            <div className="input-field">
              <label>Time Since Last Break (minutes)</label>
              <input
                type="number"
                value={lastBreak}
                onChange={(e) => setLastBreak(e.target.value)}
                placeholder="Minutes since last break"
                min="0"
              />
            </div>
          </div>

          <button 
            className="predict-button"
            onClick={predictBurnout}
            disabled={loading}
          >
            {loading ? 'Analyzing...' : 'Analyze Wellbeing'}
          </button>
        </section>

        {error && (
          <div className="error-message">
            <FiAlertCircle /> {error}
          </div>
        )}

        {prediction && !error && (
          <section className="result-section">
            <div 
              className="risk-indicator"
              style={{ backgroundColor: getRiskColor(prediction.risk_level) }}
            >
              <h2>Risk Level: {prediction.risk_level}</h2>
              <FiCheckCircle className="risk-icon" />
            </div>

            <div className="recommendations">
              <h3>Recommendations</h3>
              <ul>
                {prediction.recommendations.map((rec, index) => (
                  <li key={index}>{rec}</li>
                ))}
              </ul>
            </div>
          </section>
        )}
      </main>

      <footer className="app-footer">
        <p>Take care of your digital wellbeing ❤️</p>
      </footer>
    </div>
  );
}

export default App;
